description:
Em có mảnh đất ngay trung tâm của TT Trâu Quỳ, Gia Lâm, Hà Nội cần bán:
- Nằm ngay khu dân cư đông đúc, kinh doanh ngày đêm;
- DT 33.7m2, mt hậu 3.5m;
- Hướng ĐN đón nắng sớm cực tốt và mát mẻ mùa hè, ấm mùa đông;
- Đường oto con vào tận đất;
- Cách phố Ngô Xuân Quảng chỉ tầm 20-30m;
- Sổ sách đầy đủ sang tên;
- Giá chỉ 4.3 tỷ có gia lộc khi mua bán
LH em Huyền sdt/Zl để xem 24/7...và hỗ trợ
